import React from "react";
// import What from './What/What';
import classes from "./PsGalleryPrw.module.css";

function PsGalleryPrw(props) {
  return (
    <div className={classes.PsGalleryPrw}>
      <h1>props.title</h1>
    </div>
  );
}

export default PsGalleryPrw;
